"use strict";
var _fieldTester = require("syracuse-ui/lib/tests/field/fieldTester");
exports.load = function(page) {
	var $props = page.$prototype.$properties;
	$props.embededPDF = {
		$isTitleHidden: true,
		$type: "application/pdf",
		$url: "/syracuse-ui/lib/tests/binary/binarytest.pdf"
	};
	$props.embededPNG = {
		$isTitleHidden: true,
		$type: "image/png",
		$url: "/syracuse-ui/lib/tests/binary/binarytest.png"
	};
	page.setTitle("Binary Fields");
	_fieldTester.load(page);
	page.addFieldBlock(page.leftCol, "PDF", ["embededPDF"]);
	page.addFieldBlock(page.leftCol, "PNG", ["embededPNG"]);
	page.addMetaDataBox();
	page.applyChange({
		embededPDF: {},
		embededPNG: {}
	});
};